Fighters (Digital Playground) [BDRip]

CAST
BiBi Jones, Charles Dera, Erik Everhard, Jesse Jane, Kayden Kross, Manuel Ferrara, Ramon Nomar, Riley Steele, Scott Nails, Stoya, Tommy Gunn, Toni Ribas

Fighters (DVD + Blu-Ray Combo): Two beautiful, passionate girls from opposite walks of life come together in a battle of lust, raw emotion, egos and unyielding wills to fight it out in a stealthy boxing match. Gorgeous yet tough Jesse Jane combats her troubled home life with her perverted, skirt chasing father, Tommy Gunn, and finds her intense desire to fight with the help of her naughty sister, Riley Steele, and compassionate coach, Scott Nails. Sexy Kayden Kross punches out her deep seated feelings with a fiery need for boxing, supported by her sexually ravenous friend Stoya and a horny young house guest. Fueled by their inner demons, Jesse and Kayden come face to face in the best performances of their careers, ready to box it out and ultimately test whose desire and passion will prevail.

